// -------------------------------------------------------------
// This file contains the list of all products available in the shop.
// Each product includes: id, name, price, description, and image path.
// It is used by Redux to load products into the app.
// -------------------------------------------------------------

import { Product } from "../../types";

// -------------------------------------------------------------
// üõçÔ∏è List of all available products
// -------------------------------------------------------------
// Each product follows the Product type structure:
// { id, name, price, description, image }
// -------------------------------------------------------------

export const Products: Product[] = [
  {
    id: "Bread",
    name: "Bread",
    price: 1.10,
    description: "Freshly baked soft bread.",
    image: "/images/Bread.png",
  },
  {
    id: "Milk",
